import React from 'react'
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const SignUp = () => {
  return (
    <>
    <Head>
      <title>Sign Up | My Bird</title>
    </Head>
        <AppLayout><div>Hello SignUp</div></AppLayout> 
    </>
  )
}

export default SignUp;
